  const handleButtonClickAndToggle = () => {
    handleButtonClick();
    toggleModalOpen();
  };
  return (
    <>
      <h2>ContextQ1Detail</h2>
      {isModalOpen ? (
        <button onClick={handleButtonClickAndToggle}>숨기기</button>
      ) : (
        <button
          onClick={handleButtonClickAndToggle}
          disabled={handleButtonClick < 2}
        >
          보이기
        </button>
      )}
      <ContextQ1Detail2 />
    </>
  );
};
